// import logo from './logo.svg';
import './signup-form.css';
import React from 'react'

class SignupForm extends React.Component {
    render() {
        return (
                <div id="signup-form">
                    <div id="signup-title">
                        signup with email
                    </div>
                    <input type="text" id="input-email" class="input" placeholder="Email" />
                    <input type="text" id="input-password" class="input" placeholder="Password" />
                    <button id="signup-submit">signup</button>
                    <div id="no-account">Don't have an account?</div>
                    <div id="sign-up">SIGN UP NOW</div>
                </div>
        )
    }
}

export default SignupForm;
